package com.opencn.mesh.endpoint;import com.alipay.sofa.runtime.api.annotation.SofaClientFactory;import com.alipay.sofa.runtime.api.client.ReferenceClient;import com.alipay.sofa.runtime.api.client.param.BindingParam;import com.alipay.sofa.runtime.api.client.param.ReferenceParam;import com.alipay.sofa.runtime.service.binding.JvmBindingParam;import com.opencn.mesh.model.BizModel;import com.opencn.mesh.service.BizCommonService;import org.springframework.web.bind.annotation.GetMapping;import org.springframework.web.bind.annotation.RestController;@RestController("/")public class TrafficEndPoint {    @SofaClientFactory    private ReferenceClient referenceClient;    @GetMapping("req")    public void req(BizModel<Object> bizModel) {        BizModel<Object> bizModel1 = BizModel.builder()                .bizData("")                .bizName("ctn-tracking")                .bizVersion("1.0.0-SNAPSHOT")                .apiKey("ssssss")                .build();        ReferenceParam<BizCommonService> referenceParam = new ReferenceParam<>();        referenceParam.setInterfaceType(BizCommonService.class);        referenceParam.setUniqueId("v1");        referenceParam.setJvmFirst(true);        BindingParam bindingParam = new JvmBindingParam();        referenceParam.setBindingParam(bindingParam);        BizCommonService proxy = referenceClient.reference(referenceParam);        proxy.request(bizModel);        referenceParam.setInterfaceType(BizCommonService.class);        referenceParam.setUniqueId("v2");        referenceParam.setJvmFirst(true);        BizCommonService proxy2 = referenceClient.reference(referenceParam);        proxy2.request(bizModel);    }}